import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  var socket = io.connect("http://loaclhost:4000")
  const [question, setQuestion] = useState("");
  socket.on('question', function(q){
    setQuestion(q)
  });
  return (
    <p>{question}</p>
  );
}

export default App;
